import React,{useState,useEffect} from 'react'
import productos from '../produtos.json'
import Card from '../components/card'
import { withRouter } from 'react-router-dom';

const Listado = () =>{
    return (
         <div className = "">
             {productos.map((items=>(
                 <div>
                 <Card data = {items}/>
                 </div>
             )))}
            
         </div>
            
    )
}


export default withRouter(Listado)
